const featureFlags = {
  FeatureFlagOn: true,
  FeatureFlagOff: false,
};
function isFeatureEnabled(feature, Env) {
  if(Env === 'Dev' && feature === FeatureFlagOn){
    return featureFlags[feature] === true;
  }else{
    return featureFlags[feature] === false;
  }
}
export default isFeatureEnabled
